import { Link } from "react-router-dom";

const SearchResults = ({albums, artistName, onAddToLibrary }) => (
  <div>
    {albums.map(album => (
      <div key={album.id}>
        <img src={album.cover_medium} alt={album.title} />
        <p>{artistName}</p>
        <h3>{album.title}</h3>
        <button 
        onClick={() => onAddToLibrary(album)}>Agregar a biblioteca</button>
        <Link to={`/song/${album.id}`}>Ver detalles</Link>
      </div>
    ))}
  </div>
);

export default SearchResults;
